import React from 'react';
import '../App.css';
import file from '../shuryo.png';
import styled from 'styled-components';

function Shuryo() {
  const Image = styled.img `
    border: 5px solid #fff;
    width: 100px;
    height: 100px;
    border-radius: 100%;
    object-fit: cover;
    &:hover {
      border: 5px solid #b3424a;
    }
  `;
  return (
    <Image src={file} alt="logo" />
  );
}

export default Shuryo;
